import React from 'react';

function CookieBanner(props) {
  const style = {
    position: 'fixed',
    bottom: 0,
    width: '100%',
    backgroundColor: '#000',
    color: '#fff',
    textAlign: 'center',
    padding: '15px',
    fontFamily: '"Times New Roman", serif',
    fontSize: '14px',
    zIndex: 1000,
  };

  const buttonStyle = {
    backgroundColor: '#d4af37',
    border: 'none',
    padding: '8px 15px',
    marginLeft: '10px',
    cursor: 'pointer',
    fontWeight: 'bold',
  };

  return React.createElement('div', {style: style},
    'We use cookies to enhance your experience.',
    React.createElement('button', {style: buttonStyle, onClick: props.onAccept}, 'Accept')
  );
}

export default CookieBanner;
